  [],\n\t\"revision_timestamp\": \"2016-07-27T22:56:20.673075\",\n\t\"name\": \"lostwood-wetland-management-district-annual-narrative-report-calendar-year-1990\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lostwood
  Wetland Management District outlines accomplishments during the 1990 calendar year.
  The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is discussed. The planning section discusses management plans.
  Wetland Management District administration is outlined; information about personnel,
  youth programs, volunteer programs, funding, and safety is given. Habitat management
  is also covered; subjects include wetlands, croplands, grasslands, other habitats,
  grazing, haying, fire management, pest control, and WPA easement monitoring. The
  wildlife section of the report discusses endangered and threatened species, waterfowl,
  marsh and water birds, raptors, other migratory birds, game mammals, and other resident
  wildlife. The public uses of the District described in this report include interpretive
  programs, hunting, and law enforcement. The equipment and facilities section of
  the report provides information about new construction, rehabilitation, and equipment
  utilization and replacement. Cooperative programs and items of interest are provided
  at the end. A brief narrative on Shell Lake National Wildlife Refuge is also included.
  Photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
